import React, { Component } from 'react';
import Link from "next/link";
import styles from "./navbar.module.css";
import { HamburgerButton } from 'react-hamburger-button';
import Popup from "reactjs-popup";
import { slide as Menu } from "react-burger-menu";

const NavMenu = [
    {
      path: "/blog", name: "Blog",
    },
    {
      path: "/#", name: "100DaysofCode",
    },

    ]


class NavBarState extends Component {
constructor (props) {
  super(props)
  this.state = {
    menuOpen : false
  }
}
handleStateChange (state){
  this.setState({menuOpen: state.isOpen})
}

closeMenu () {
  this.setState({menuOpen: false})
}


    render() {
        return (
            <header className={styles.header_Wrapper}>
            <div className={styles.div_top_hypers}>
              <div className={styles.logo_left}>NdV</div>
              <ul className={styles.ul_top_hypers}>
               {NavMenu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>

               ))} 
                </ul>
                 </div>
                 <div className={styles.menu_right}>      <Menu noOverlay width={280} isOpen={this.state.menuOpen} onStateChange={(state)}>
        <a id="home" className="menu-item" href="/">Home</a>
        <a id="about" className="menu-item" href="/about">About</a>
        <a id="contact" className="menu-item" href="/contact">Contact</a>
        <a onClick={ this.showSettings } className="menu-item--small" href="">Settings</a>
      </Menu></div>
            </header>
        );
    }
}

export default NavBarState;
